you unpublish an element, the tag does not need to be removed to undisplay the element.</p>','1','1212843296FJPT'),('Position','1','1213695731KPWL'),('Information','1','1215507792MTRU'),('Pagination style','1','1216230542PQQX'),('<ul><li>Lean: just the page numbers</li><li>No total: standard without the total number of pages</li><li>Standard: optimal pagination</li><li>Complete: all possible buttons<br></li></ul>','1','1216230542PQQZ'),('Folder','1','1217603897AYYA'),('Buttons','1','1217603899SJDA'),('Filename','1','1217603899SJDE'),('Button','1','1219769905FKPU'),('Vendors','1','1220793715LTKS'),('Close','1','1228820287MBVC'),('Users','1','1229653442FEQZ'),('Items','1','1233642085PNTA'),('<br><br><br>','1','1234467594BCKE'),('Edit Theme','1','1238171026KDKW'),('Time','1','1242282413PMNG'),('Breadcrumbs','1','1242282414LZMP'),('Toolbar','1','1242282435FMHV'),('Miscellaneous','1','1242282437ISFV'),('Done','1','1242282449PIPC'),('Icons','1','1242282450QJAT'),('Star Color ','1','1251285854FOAP'),('Widget','1','1251697929ABZD'),('Thumbnail','1','1253939321KJPL'),('testing','1','1260156272HYPW'),('<p>Below are the list of all themes used by the installed applications.  You can customize those themes as you wish. The modification will affect how the data are rendered.</p><p><strong>Note:</strong> To customize a theme you need to \"<span style=\"color:#FF0000\"><strong>CLONE</strong></span>\" to be able to edit the file. The cloned theme will be automatically set as the default theme. Cloning a theme is important so you can easily update without losing your customized code.</p><p><span style=\"color:#FF0000\"><strong>Edit Theme Button: </strong></span>You can access the theme design and customize the look and feel of your store without having to enter a single code.<br><span style=\"color:#FF0000\"><strong>Minify: </strong></span>Minify the themes to lessen the size of the file and improve page load.<br><strong>Hint:</strong></p><p>*You can\'t <strong>delete</strong> a theme which is <strong>core</strong>. You can only delete uncore theme.<br>**You can\'t <strong>unpublish</strong> a theme which is set as <strong>default</strong>. Kindly choose another one as default and then unpublish. Moreover, you can\'t set as default a theme that is not published. Kindly publish and then set as default.</p>','1','1271819049DNZB'),('Origin','1','1273655191NLYX'),('Clone','1','1298294078HATF'),('Main Files','1','1298294079SVND'),('Successfully saved the file $file','1','1298294183ETWL'),('Kindly enter a folder name','1','1298350435GKOB'),('The folder \"$folder\" already exists. Kindly enter another folder name.','1','1298350435GKOC'),('do we need to customize only one item that can be set as default?','1','1298350436LSKP'),('Folder name','1','1298350437HNTL'),('Clone Theme','1','1298350437HNTN'),('Theme main files','1','1298350437HNTO'),('Theme custom view  files','1','1298350437HNTP'),('Theme stylesheet files','1','1298350437HNTQ'),('Theme js files','1','1298350437HNTR'),('Theme Edit File','1','1298350437HNTS'),('Upload a theme','1','1298350438DLWR'),('Column 1','1','1298350843FMVJ'),('Column 2','1','1298350843FMVK'),('Downloads','1','1298388027HWEM'),('<p><strong>Information Tab:</strong> Short information about the theme<br />\r\n<strong>General Design Tab:</strong> You can define the general look and feel of all Application in the backend and front-end. This option is accessible through <strong>Joomla 3.2 Responsive Admin Theme</strong>.<br />\r\n<strong>Catalog Design Tab:</strong> You can customize different options to change the look and feel of your store such as button color, sizes and icons. This option is accessible through <strong>Joomla 3.2 Responsive Theme</strong>.</p>','1','1300111184CKDD');
