INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Define to use HTML or not in the tooltip.<br>','1','1396670886HSVY'),('Define the position of the icon within a standalone button.<br>','1','1396670886HSVZ'),('Define the icon of the view map button.<br>','1','1396670886HSWA'),('Define the size of the view map button.<br>','1','1396670886HSWB'),('Define the color of the view map button.<br>','1','1396670886HSWC'),('Define the icon of the edit address button.<br>','1','1396670886HSWD'),('Define the size of the edit address button.<br>','1','1396670886HSWE'),('Define the color of the edit address button.<br>','1','1396670886HSWF'),('Define the size of the ask question button.<br>','1','1396670886HSWG'),('Define the color of the question button.<br>','1','1396670886HSWH'),('Define the size of the view all button.<br>','1','1396670886HSWI'),('Define the icon of the view all button.<br>','1','1396670886HSWJ'),('Define the color of the view all button.<br>','1','1396670886HSWK'),('Define to use Joomla breadcrumb in the catalog or not.<br>','1','1396670886HSWL'),('Define to use Joomla breadcrumb in the cart or not.<br>','1','1396670886HSWM'),('<span style=\"text-decoration: underline;\">Themes Tab</span>: for the list of main files of the theme.<br><span style=\"text-decoration: underline;\">Custom Views Tab</span>: list thef files for the custom views of the theme.<br><span style=\"text-decoration: underline;\">Stylesheets Tab</span>: for the list of css files of the theme.<br><span style=\"text-decoration: underline;\">Javascripts Tab</span>: for the list of js files of the theme.<br><br><span style=\"text-decoration: underline; font-weight: bold; color: rgb(255, 102, 0);\">Hint:</span><br><span style=\"font-weight: bold;\">What is the difference between the .css file and the .uncompressed.css file?</span><br style=\"font-weight: bold;\"><br>The uncompressed file is the original file with readable return to the line and spacing. The compress file is optimized for loading speed.<br>If you want to edit a lot of css it is probably more convenient to first copy the uncompressed.css file to the .css file in order to easily find the proper CSS.<br><br><br><span style=\"color: rgb(0, 0, 204);\"><span style=\"text-decoration: underline;\">Note</span>: If the theme is \"Core\" you cannot edit the files. If you wish to edit the theme simply make a clone and edit the files of the clone. The cloned theme will be automatically marked as default.  Click Clone button to create a clone of this theme</span><span style=\"color: rgb(255, 0, 0);\"><span style=\"color: rgb(0, 0, 204);\">.</span><br></span><span style=\"color: rgb(255, 0, 0);\">This procedure enables to keep the original untouched and avoid your customization to be overwritten at update.</span><br><br>Click the filename to edit a file.<span style=\"color: rgb(255, 0, 0);\"></span>','1','1396670886HSWN'),('Column Icons Colored','1','1397142434IGLD'),('Define to use colored icons or not for the control icons in the columns ( eg: publish, edit, etc... ).<br>','1','1397142435SAFZ'),('Vendor Register Button','1','1397671863NNJA'),('Define the size of the vendor register button.','1','1397671864NQDV'),('Define the color of the vendor register button.','1','1397671864NQDW'),('Define the icon of the vendor register button.','1','1397671864NQDX'),('Add to Cart Button in Listing','1','1397783154DRZE'),('Add to Cart Button in Item Page','1','1397783155AUTG'),('Define the size of the add to cart button in the listing page.<br>','1','1397783156CAWV'),('Define the color of the add to cart button in the item listing.<br>','1','1397783156CAWW'),('Define the icon of the add to cart button in the item page.<br>','1','1397783156CAWX'),('Carousel Navigation Button','1','1397784635QHPJ'),('Define the color of the carousel arrows buttons.<br>','1','1397784636NFCW'),('Star Icon','1','1397875863SIJY'),('Star Size','1','1397875863SIJZ'),('Define the size of the star icon.<br>','1','1397875864HNPT'),('Define the color of the star icon.<br>','1','1397875864HNPU'),('Group Icons','1','1398174984KSWN'),('Yes to group the icons together in one bar. Otherwise each icon are separated by a space.<br>','1','1398174985PICN'),('Define the position of the icon in the button.<br>','1','1398196675ECCG'),('Identifier','1','1398436917DTKC'),('Skin','1','1399505622LUTN'),('Choose a skin for the theme.<br>','1','1399505625PJLS'),('Vendors\' custom','1','1399595651JURP'),('Remove Bootstrap file','1','1399988028FPZA'),('Click Yes to NOT add the bootstrap CSS file.<br><div>Use this option to use the bootstrap file from the CMS template.</div><div>If you click Yes the Skin preference cannot be use any more.</div>','1','1399988029JPTN'),('Remove legend','1','1400256255AHCT'),('If yes the legend at the bottom of the page will be removed.','1','1400256256TGRK'),('Font Awesome Icon','1','1400708734QLWF'),('Create a font awesome icon','1','1400708734QLWG'),('Define a button','1','1400708734QLWH'),('Twitter Icon Color','1','1402436712SWTH'),('Google Icon Color','1','1402436712SWTI'),('Facebook Icon Color','1','1402436712SWTJ'),('Define the color of the Twitter icon.<br>','1','1402436713RMMP'),('Define the color of the Google icon.<br>','1','1402436713RMMQ'),('Define the color of the Facebook icon.<br>','1','1402436713RMMR'),('Tooltip Style','1','1415377877PTRF'),('Define the position and style of the tooltip','1','1415377877PTRG'),('Public Site','1','1416822016EIWM'),('Admin Panel','1','1416822016EIWN'),('An occured while uploading the file.<br /> Please try to upload again','1','1417812852DFNC'),('The file $FILENAME could not be found!','1','1420549276ICAG'),('<p>Enter the destination folder of the files of the theme that you want to copy.<br />\r\nThe folder name should not have whitespaces and special characters like (, ),  !, @, #, $, % ,^, &, and *. Click Ok to submit.<br />\r\n<br />\r\n<span style=\"color:rgb(0, 0, 0)\">Kindly do not leave the input box empty.</span><br />\r\n<span style=\"color:rgb(0, 0, 0)\">Make sure also that the folder name is unique.</span></p>','1','1420549280BNHL');
