,('Email Notification','1','1213353034DMQG'),('Advance feature to show the code errors when they occur. With this option, only guests will see the errors (you can use it when you need to see an error occurring somewhere accessible only by unregistered users like the registration page)','1','1213369263SAAF'),('Debug Errors','1','1213369263SAAG'),('Debug Queries','1','1213369263SAAI'),('Information','1','1215507792MTRU'),('The Widget was unpublished with success.','1','1215710386RMJC'),('The Widget was published with success.','1','1215710386RMJD'),('<span style=\"font-weight: bold;\">It is recommanded to use the highest level of security.</span><br>Should you want to trade some security for some performance you could lower the security level.  <br>Basic security, like filter for SQL injection are always covered. <br>','1','1217930839LUIO'),('Security Level','1','1217930839LUIP'),('Performance','1','1217930839LUIR'),('Specify and email address for administration and maintenance notification.<br>If left empty all administrator will be notified.<br>','1','1217930839LUIS'),('Caching','1','1217930839LUIT'),('Button','1','1219769905FKPU');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Pick-list','1','1219769913SSOH'),('Installation','1','1219770756BFUL'),('Translations','1','1220793710GXYB'),('Vendors','1','1220793715LTKS'),('A demo license could not be retrieved because you already evaluated this application on this website.','1','1227579883OZMZ'),('Grade','1','1227579895DRET'),('Please use this form to contact us.  <br><ul><li>Based on your subject you will be redirected to the right section of our website: either the ticket system or the forum.</li><li>It is also important that you select the right application.</li><li>We look forward to hearing from you.</li></ul>','1','1227579895DREU'),('nestedapplication','1','1227580613HBMJ'),('nestedlanguage','1','1227580613HBMK'),('Update','1','1227580898LIDX'),('Current version','1','1228709213SHFK'),('The server which is contacted to install or updates development releases.<br>','1','1228820067NJRS'),('Distribution server','1','1228820067NJRT'),('Joobi Care','1','1228820286IIZC'),('Query successfully executed!','1','1229651871ADBG'),('One of the query failed!','1','1229651871ADBH'),('List of applications updated.','1','1229651871ADBI'),('The version currently installed on your website<br>','1','1229651877RBLQ'),('The latest version available<br>','1','1229651877RBLS'),('Enter your query here.<br>','1','1229651877RBLT'),('Click Yes if you want to see the result of the query.<br><span style=\"text-decoration: underline; color: rgb(204, 0, 0); font-weight: bold;\">Warning:</span> Don\'t click Yes if you run many queries all at once.<br>','1','1229651877RBLU'),('The author of the application<br>','1','1229651877RBLV'),('Query','1','1229651877RBLW'),('See result','1','1229651877RBLX'),('Execute','1','1229651877RBLY'),('Application information','1','1229651878KNMW'),('<ul><li>Before installing / updating any application on the website, we recommend that you do a backup of the website files and database. This way, you will always be able to revert the changes made during the install / update in case of an error.</li><li>Setting the website in maintenance mode is also recommended for updates.</li></ul>','1','1229651878KNMX'),('<ul><li>Enter the query you want to run on your server.</li><li>If you have several queries, use a semi-column ( ; ) to sepate the queries.</li><li><span style=\"color: rgb(204, 0, 0);\">Use the option to show the results only if you have few queries.</span></li></ul>','1','1229651878KNMY'),('Run Query','1','1229651878KNMZ'),('Users','1','1229653442FEQZ'),('Test email','1','1230529131MQQP'),('IP','1','1230531895KYXK'),('<span style=\"font-weight: bold; color: rgb(204, 0, 0);\">Be very careful with this feature!</span><br>The move of the license is automatic and cannot be reversed within the next 3 months.<br>Please enter the new website URL to which you want to move the license to.<br><br>','1','1230874957AEGZ'),('<ul><li>Please enter the API key you received by email or any other mean in order to get new update.</li></ul>','1','1230874957AEHC'),('<span style=\"font-weight: bold; color: rgb(204, 0, 0);\">Please be very carefull with this feature!</span><br>As specified in the license agreement a license can only be moved every 3 months.  The move of the license will be automatic and irreversible within the next 3 months.<br>','1','1230874957AEHD'),('Beta','1','1231158811CQTU'),('Application in Beta','1','1232547361JEQR'),('Items','1','1233642085PNTA'),('Image Position','1','1234467597SEXO'),('The application has been successfully set to Core.','1','1235976558LLLB'),('This application is not installed!','1','1235976558LLLC'),('Your license expired!','1','1235976558LLLD'),('Reset to Default','1','1237967600IVIO'),('Save as Default','1','1237967600IVIP'),('Default WYSIWYG editor for the user in the front-end of the site.<br>','1','1238171067TJFA'),('download','1','1240388999GQSW'),('Confirm','1','1240912077BELS'),('Time','1','1242282413PMNG'),('Memory Usage','1','1242282413PMPV'),('Last Updated','1','1242282416HAOE'),('Never','1','1242282417SQNR'),('Show Page Title','1','1242282435FMDW'),('Install from URL','1','1242282443EZXY'),('Uninstall','1','1242282443EZZS'),('Browser','1','1242282449PIOD'),('Done','1','1242282449PIPC'),('Media','1','1242282450QJCF'),('Show all the query executed. Only you will see them.','1','1242617238FPTQ'),('Advance feature to show the code errors when they occur. Only you will see them.','1','1242617238FPTR'),('Debug Errors Guest','1','1242617238FPTT'),('Framework','1','1243392688MXHE'),('The application has been successfully updated!','1','1245769651NPXC'),('Widget file Uploaded','1','1247466190MROL'),('Please fill one of the fields','1','1248835367AECZ'),('Install from folder','1','1248835373QZQO'),('The folder $FOLDER is not a valid extension folder','1','1248948187IFCW'),('Select the package with the browse button and click install.<br>','1','1249442155KSPX'),('Enter the URL of your package and click install.<br>','1','1249442155KSPY'),('Enter the path to the folder and click install.<br>','1','1249442155KSPZ'),('Enter package','1','1249442156QUCN'),('Recommended','1','1249442156QUCO'),('Alternative options','1','1249442156QUCP'),('Install Manager','1','1249442157SIBQ'),('It seems that the installer was unable to remove the temporary folder for install files on last install due to an access rights issue. Before trying to update/install again, please remove the folder $FOLDER via FTP.','1','1249562683MMMY'),('The file type ($FILE_EXTENSION) is not in the list of valid types : $EXTENSIONS','1','1249567958KVAQ'),('The user\'s browser has a list of preferred languages. When not logged in, this data can be use to check if those languages are available for the Joobi application and use the preferred available one. By default the Browser order is 1 which means that it\'s the first source used to decide the language to be displayed.<br>','1','1250777204RIAD'),('When the ip tracker is installed, it can detect the country where the user is by looking at his IP address. Then, the system can use the language associated with the detected country to display the joobi applications, if the language is available for joobi applications. If the ip tracker application is not installed, this option will be skipped. By default, the IP based language detection is done after the browser based detection if the browser detection was unsuccessful. Thus, its ordering value is 2 by default.<br>','1','1250777204RIAE'),('Saving of General Preferences','1','1251534480QHPE'),('This website has been added to your site manager.','1','1251770410PASS'),('This website could not be added.','1','1251770410PAST'),('Refresh all licenses','1','1251857784QRWO'),('Could not identify your website URL.','1','1251905717NHWT'),('Your website was not found. Please contract support.','1','1251905717NHWU'),('The licenses have been updated!','1','1251905717NHWW'),('There is a problem with the Localhost license.','1','1251905718PEOQ'),('The license could not be installed for $APPLICATION because the application is not yet installed.','1','1251905719IQBZ'),('The license could not be installed for application: $APPLICATION','1','1251905719IQCA'),('No licenses were found for this website.','1','1251912852OWAG'),('An error occur while installing the licenses!','1','1251959063BNBJ'),('Click Yes to force \"https\" secure internet on the Back-End.','1','1251988094BIBR'),('File Size','1','1252569179LCYI'),('File Name','1','1252569179LCYJ'),('User Logs','1','1252569179LCYK'),('User Log Details','1','1252569179LCYL'),('User Logs Details','1','1252569180FERI'),('Log Download','1','1252894206NMXU'),('User Log Delete','1','1252894206NMXV'),('Logs','1','1253200893CXZC'),('Click Yes to force \"https\" secure internet on the Front-End.','1','1254100130KOZM'),('Click No to turn off any communication with external website.<br>Note: turning this option Off will disable application updates and limit some of the functionality of the site. <br>','1','1254100130KOZN'),('Force SSL Front-End','1','1254100130KOZO');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Force SSL Back-End','1','1254100130KOZP'),('The system can also try to use the Framework ( Joomla, Wordpress, etc ) detected language if it is available for joobi applications. By default, this is done after the other detection systems, thus, its ordering value is 3. If you set its ordering lower than the others, the system will use the framework language if available.','1','1257940976WWP'),('testing','1','1260156272HYPW'),('There are no logs available at this time. Please check again later.','1','1260434893HJHQ'),('Log file $FILE successfully deleted','1','1260434893HJHR'),('Log file cannot be previewed because it is too big (1MB max)','1','1260443578NNAV'),('Apps','1','1267607212GWJP'),('Total No. of New Apps','1','1267764045MNMG'),('Total No. Of Apps','1','1267764045MNMH'),('Number of Apps installed','1','1267764045MNMI'),('Out of Date Apps','1','1267764045MNMJ'),('Apps Report Dashboard','1','1267764046CYTO'),('Use this view to install packages. It can be widgets or even applications. There are three different ways to install a package.<br><ol><li><span style=\"text-decoration: underline;\">Install from package</span>: <span style=\"color: rgb(0, 102, 0); font-weight: bold;\">(Recommended)</span> Simply use the browse button to find your file on your computer and click install.</li><li><span style=\"text-decoration: underline;\">Install from an URL</span>: This can be an external URL. Enter the URL and then click install.</li><li><span style=\"text-decoration: underline;\">Install from a folder</span>: You might have the package extracted in a folder on your server , use this option to specify the folder and then click install. This option can be useful when the package is big and that your PHP upload limit is not enough or that your server times out.<br></li></ol>','1','1271818792LETO'),('Define which distribution server you want to use.<br>None: to disable updates and installs.<br>Production: <font color=\"#CC0000\">Recommended choice</font>. <br>Beta: to get latest beta releases.<br>Dev: <i>Not recommended, only use if advised by developers</i>.<br>','1','1271819434SRVJ'),('Script Type','1','1290670039OOGW'),('Your Cron Task on $HOMESITE is active and working!','1','1298294128HPXJ'),('The Cron Task on $HOMESITE could not be activated, check with support team...','1','1298294128HPXK'),('Package successfully installed','1','1298294132BJZM'),('Advance','1','1298294169DGIW'),('Total Apps','1','1298294174MWUX'),('Installed Apps','1','1298294174MWUY'),('Total No. of New Updated Apps','1','1298294174MWUZ'),('An unknown error happened while featching licenses.','1','1298350280PMMA'),('Apps Extra info','1','1298350283NKJB'),('Apps Level','1','1298350283NKJC'),('Apps Dependency','1','1298350283NKJD'),('Apps Information','1','1298350283NKJE'),('Apps Translation','1','1298350283NKJF'),('Apps Level Trans','1','1298350283NKJG'),('Application Versions','1','1298350284IYPA'),('Enter a Query','1','1298350285IISM'),('Enter an SQL query','1','1298350286CSUD'),('Excecute an SQL query','1','1298350286CSUE'),('Cancel query','1','1298350286CSUF'),('External Communication','1','1298350446IEXL'),('Advance Column 1','1','1298350446IEXU'),('Advance Column 2','1','1298350446IEXV'),('General Column 1','1','1298350446IEXW'),('General Column 2','1','1298350446IEXX'),('Home Site','1','1298350446IEXY'),('This is different than the previous option.  It enables you to turn On/Off the wizard for everyone in the Front-end.<br>','1','1298350449IJXC'),('The website providing applications.<br>','1','1298350453HVAO'),('Column 1','1','1298350843FMVJ'),('Downloads','1','1298388027HWEM'),('Application Languages','1','1299065683HDEE'),('Administrator Notification','1','1299215253RNKY'),('Define the level of caching for the website.<br>The highest the caching the better the performance but also the more memory used. <br>','1','1299215254OXTM'),('Define which page update technology you want to use.<br><span style=\"font-weight: bold;\">AJAX </span>- default and recommended.<span style=\"font-weight: bold;\"><span style=\"font-weight: bold;\"><br></span></span>','1','1300434114HUML'),('This is <span style=\"font-weight: bold;\">Auto Save</span> time interval.<br>The time you want your form to be saved.<br>User per second. Default is <span style=\"color: rgb(102, 0, 0);\">30</span> sec.<span style=\"font-weight: bold;\"><br><span style=\"font-weight: bold;\"></span></span>','1','1300434114HUMM'),('Auto Save  Time Interval','1','1300844255DUTL'),('The plugin \'Cron Task\' has been automatically $ENABLED','1','1303354916DPMU'),('Msg #','1','1304258958RSVK'),('','1','1304525968YBL'),('This is to load mootools first before you load jquery.<br>','1','1304526022JRUH'),('Render an Tag','1','1304916603TJKB'),('Multilingual Content Site','1','1306429442RXVJ'),('Developer Test Case','1','1306926884BHVV'),('Load Mootools first','1','1309406593PBSN'),('Click Yes to show the page title in the website front-end. No to remove it.<br>','1','1309406599MYMN'),('Reinstall','1','1310984711PXOI'),('Apps Reinstall','1','1310984741ESTO'),('User State Memory','1','1312946243NCTM'),('Specify what system should be use to remember the state of views when user navigate.<br><span style=\"color: rgb(0, 0, 204); text-decoration: underline;\">cookie:</span> enable the user to come back to they previous navigation even after session expire.<br><span style=\"color: rgb(0, 0, 204); text-decoration: underline;\">session</span>: potentially more secure, remember the views state only in the same session.<br>','1','1312946249DMIW'),('Default Itemid','1','1313469714PHCP'),('Show Wizard in Frontend','1','1314355378KUGY'),('By default the SEF URL render a name rather than a numeric ID.<br>Click Yes if you prefer a simple ID.<br>','1','1314355381EEUK'),('Documentation Site','1','1317387080ATEF'),('The website providing documentation of the applications.<br>','1','1317387083CYMJ'),('DB prefix','1','1318938393NAXT'),('Apps Translations','1','1319035319DBIP'),('Apps Translations Import','1','1319072839DDDJ'),('List of translations','1','1326997166FYVE'),('Translation Guidelines','1','1326997166FYVF'),('Show Help in Frontend','1','1336262893OKNO'),('Click No if you don\'t want to show the Help button in the front-end.<br>','1','1336262894HGBM'),('JomSocial','1','1336691225CLYQ'),('Users have been successfully synchronized in your database!','1','1337190873HKCO'),('Sync Users','1','1337190875QXBD'),('Watermark','1','1338338319GRMW'),('Use Image Watermark','1','1338338319GRMX'),('Use Text Watermark','1','1338338319GRMY'),('Image File','1','1338338319GRMZ'),('Watermark Text','1','1338338319GRNA'),('Text Position','1','1338338319GRNB'),('Text Size','1','1338338319GRNC'),('Yes to use a watermark image.<br>','1','1338338320KGPY'),('Yes to use a watermark text.<br>','1','1338338320KGPZ'),('Specify the file path to the font file. If left empty it will use the default font.<div><div><br></div></div>','1','1338338320KGQA'),('Specify the position of watermark image.<br>','1','1338338320KGQB'),('Specify the text to use on the watermark.<br>','1','1338338320KGQC'),('Specify the position of watermark text.<br>','1','1338338320KGQD'),('Specify the font size of the text.<br>','1','1338338320KGQE'),('Text Color','1','1338404993PTOB'),('Text Opacity','1','1338404993PTOC'),('Text Roration','1','1338404993PTOD'),('Font File','1','1338404993PTOE'),('Specify the file path to the image to use as a watermark. <font color=\"#cc0033\">The image needs to be either PNG or JPG.</font><div>Start at the root of your site.<br><div><br></div></div>','1','1338404993PTOF'),('Specify the font color of the text using HEX notation.<br>','1','1338404993PTOG'),('Specify the text opacity over the image.<br>','1','1338404993PTOH'),('Specify the text rotation in degrees (eg: 90, 270 ).<br>','1','1338404993PTOI'),('Distribution Server','1','1338573341FLOL');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Auto Check for Update','1','1338573341FLOM'),('Beta distribution server','1','1338573341FLON'),('Send me an email when new updates are available.','1','1338573341FLOO'),('The server which is contacted to install or updates production releases.<br>','1','1338573341FLOP'),('Specify what type of update you want to be inform about.','1','1338573342KOJF'),('Update a preference by URL','1','1338573342KOJG'),('Apps update is disabled!','1','1338581028LZCR'),('You need to define a preference node name (node=...)','1','1338581054ANGS'),('You need to define a preference name (name=...)','1','1338581054ANGT'),('Successfully updated preference!','1','1338581054ANGU'),('The Apps are running in beta. Beta mode should not be used in production website!','1','1338581058MKNK'),('Allow Apps\' Sound','1','1341595702FCVU'),('Yes to allow applications to use sounds on events.<br>','1','1341595703RHEE'),('All log files have been deleted!','1','1342037586EZIY'),('Delete all log files','1','1342037592PDAA'),('Final step of the installer','1','1345316856HADW'),('Delete the installer and refresh screen.<br>','1','1345316856HADX'),('Force English Back-end','1','1345820470LDJX'),('Force the back-end to English language.<br>','1','1345820471OJLX'),('Direct Editing','1','1347651808CPWG'),('Who Can Edit','1','1347659841ODKB'),('Specify the user\'s role which can access the direct edit.','1','1347659842QEDP'),('Successfully refreshed applications data.','1','1347915878MZME'),('Joomla Content Plugin','1','1348621630FUBX'),('Yes to load and execute Joomla content plugins for introduction and description.','1','1348621630FUBY'),('Install Now','1','1349115733NNHN'),('Media Player','1','1352764986KJXE'),('Use JW Player','1','1352764986KJXF'),('JW Player Key','1','1352764986KJXG'),('Update All','1','1356698583QHNC'),('Single','1','1357059110IPWM'),('API Key','1','1357296145DBZH'),('Production','1','1357387105DGOO'),('Dev','1','1357387105DGOP'),('Dev distribution server','1','1357387109KMOT'),('The server which is contacted to install or updates beta releases.<br>','1','1357387110MLJN'),('Translations successfully changed!','1','1357567981LCEH'),('Use Numeric SEF URL','1','1357696806PVXX'),('Direct Translate','1','1358515337PTMS'),('Enables to directly translate any string of the applications','1','1358515338ECWC'),('Custom Fields','1','1359165405DSBB'),('Fields for All Types','1','1359165405DSBC'),('Allow the same field to be added on all types.<br>E.g.: the same field could be added to auction, product, and download.<br>Recommended setting: No.<br>','1','1359165405DSBD'),('Use Ajax file uploader','1','1359654993NSKL'),('Define the maximum of files that can be loaded at the same time, when multiple file upload is allowed.<br><br>','1','1359654993NSKM'),('Max simultaneous file upload','1','1360922246IVLU'),('default: Yes. The file uploader displays a progress bar and allow to upload several file at a time.<br>Set to No if you experience any problem or conflict with Ajax to get standard file uploader.<br><br>','1','1360922246IVLV'),('Debug Guest Queries','1','1369749833QIRZ'),('Log Queries','1','1369749833QISA'),('Log Guest Queries','1','1369749833QISB'),('Show all the queries executed by the guests. Use when you want to display all the queries executed on a page only accessible to unregistered users.','1','1369749834AAQQ'),('Log all queries into the log file. Only queries for your session will be logged.','1','1369749834AAQR'),('Log all the queries executed by the guests. <br><u><font color=\"#FF0000\">Warning</font></u>: on a productive site with lot of traffic this could potentially generate huge files.<br>','1','1369749834AAQS'),('Show PHP error','1','1373207636DEVB'),('Show the line number into the log.<div>This require a lot more memory. Use only in debug mode and make sure you have sufficient memory.</div>','1','1373207637APRU'),('Chart dimensions','1','1375816538MEST'),('X axes','1','1375816538MESU'),('Y axes','1','1375816538MESV'),('Specify a dimension in pixel for the x axes.<br>','1','1375816539HXMZ'),('Specify a dimension in pixel for the y axes.<br>','1','1375816539HXNA'),('Tag to replace parameters','1','1377041362DLBN'),('Tag use to replace a theme area','1','1377041362DLBO'),('mailing','1','1377041362DLCA'),('Allow you to add formatted time in any content.','1','1377041362DLCC'),('Used for instance in emails','1','1377041362DLCE'),('Used in page theme.','1','1377041362DLCF'),('Render one or several item\'s categories','1','1377041362DLCG'),('Render one or several products','1','1377041362DLCH'),('Render one or several Product\'s categories','1','1377041362DLCI'),('Render a download item.','1','1377041362DLCJ'),('To render one or several items','1','1377041362DLCL'),('Render one or several vendors profile.','1','1377041362DLCM'),('Render a profile from JomSocial','1','1377041362DLCN'),('The license server is not reachable please contact support for more information.','1','1377109823CPMJ'),('The Apps are running in beta. Beta mode should not be used in production website! Site: $BETA_SITE','1','1377368277IDOY'),('The Apps are running in development mode. Development mode should not be used in production website! Site: $DEV_SITE','1','1377368277IDOZ'),('The minimum memory required is 30 Mo!','1','1378928005HOHD'),('The server only allows','1','1378928005HOHE'),('Widget to use constant','1','1379006374DSAU'),('Widget used some predefined constant.','1','1379006374DSBC'),('Widget to render a map of the specified address','1','1379006374DSBD'),('Use this widget to render an entire view.','1','1379039059BHZA'),('List of discussions','1','1379612436QWVD'),('The price widget enable to convert price in different currency automatically based on user\'s selected currency.\r\neg : {widget:price|value=50|currency=NZD|symbol=money|}\r\nsymbol values includes:\r\n\'money\' example  $21\r\n\'moneyCode\' example  $21 USD\r\n\'moneyNoSymbol\' example  21 USD','1','1380025958NOKV'),('Discussions','1','1380027946LBCD'),('<p><span style=\"color:rgb(0, 102, 204)\">Test e-mail:</span> this button enables you to test the email settings.<br />\r\nAn email will be sent to your email address based on the default server configuration.<br />\r\n<br />\r\n<strong>Scheduler </strong><br />\r\nThe tasks can be executed with a specific frequency ( for example every Day ) or at a specific date in the future.<br />\r\n<br />\r\n<strong>How does it work?</strong><br />\r\nTo launch those scheduled tasks, the scheduler needs to be triggered by something...</p>\r\n\r\n<ul>\r\n	<li>Any visit on your website can trigger the system (so no visit means no task run!)<br />\r\n	In that case you have to turn ON the option \"User Cron System\".</li>\r\n	<li><strong>OR</strong> an <a href=\"http://www.joobi.co/index.php?option=com_jlinks&controller=redirect&link=trigger_jscheduler\" target=\"_blank\" title=\"\">external system can trigger the scheduler</a> application by accessing the url :\r\n	<div><strong>{widget:site}index.php?option=com_jcenter&controller=scheduler&task=process&tmpl=component&password=</strong></div>\r\n\r\n	<div><em>(enter the password if you have set one. Copy/paste this url on your browser to see if the scheduler application get launched properly)</em></div>\r\n	<br />\r\n	This second solution is recommended as the system will be launched at fixed dates and won&#39;t depend on your website traffic.<br />\r\n	In that case you can turn OFF the option \"User Cron System\".</li>\r\n</ul>','1','1380037279FKRS'),('Items\' categories','1','1380567318QTUD'),('Products\' categories','1','1380567318QTUE'),('Render a view','1','1380567318QTUF'),('subscribers','1','1380567318QTUG'),('Discussions\' categories','1','1380567318QTUH'),('Discussion Search','1','1380567318QTUI'),('Render information about a user.\r\nName, First name, Last name, etc...','1','1380567318QTUJ'),('Direct Edit Modules','1','1381500332FVXY'),('Enables to directly edit modules from the front-end of the site.','1','1381500333LIEA'),('Default Editor Back-end','1','1385472707OHUT'),('Default Editor Front-End','1','1385472707OHUU'),('Default WYSIWYG editor for users in the back-end.<br>','1','1385472708HAZN'),('Vendors\' map','1','1386167103EEPC'),('Use Captcha','1','1389052188SONB'),('Update All Apps','1','1389123468CKOO');
INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('Need update','1','1389125413BAER'),('The API key entered does not exist.','1','1389275707OUAK'),('The application information could not be updated with the API key received.','1','1389275708EKXJ'),('API key','1','1389275714NKEJ'),('Please enter your API key.','1','1389275715RJLN'),('Enter API key','1','1389275715RJLO'),('Enter Your API key','1','1389275716SJHL'),('Problem of communication with the distribution server!','1','1389293010DETE'),('API key error!','1','1389293010DETJ'),('Club','1','1389293018JFMA'),('Install / Update instructions','1','1389293018JFMB'),('Current API key','1','1389386704BRFY'),('You demo period has expired, you can\'t update any more! Please secure an API key to get the latest update.','1','1389439751KWKS'),('Club subscription','1','1389656307QIHM'),('The Apps are running free version. Should you want to get a subscription please visit $LINK2CLUB','1','1389656307QIHN'),('The API key is not valid, it is not possible to update any more. Please update your API key or get a new one.','1','1389701736EXGV'),('The API key is valid!','1','1389701736EXGW'),('The API key is expired!','1','1389701736EXGX'),('The API key was not found, please check it again!','1','1389701736EXGY'),('The API key mismatch!','1','1389701736EXGZ'),('The API key received is not valid.','1','1389879769JPHN'),('Plan','1','1389879775LPOL'),('API keys','1','1389902747HCAE'),('Show line number','1','1390561315MZSB'),('Yes to use CDN to load the standard files, css, js, fonts, images, etc,,, instead of the local server files.','1','1390561316LWBW'),('A new distribution server has been set!','1','1392062121NBKP'),('Subscribe Mailing','1','1392294863NOGM'),('Widget to display a registration form to subscribe for a mailing','1','1392294863NOGN'),('Is the content of your website multilingual or monolingual? Yes for multilingual.<br>Multilingual will enable to save data with different language if the application allow it.  Please refer to each application to define if it allow multilingual content.<br>','1','1393953514CMZC'),('row1','1','1394069593IQAQ'),('row2','1','1394069593IQAR'),('column1','1','1394069593IQAS'),('column2','1','1394069593IQAT'),('Use Minified Files','1','1395437821GPTR'),('Use CDN','1','1395437821GPTS'),('CDN server','1','1395437821GPTT'),('This should <b>only</b> used for debugging purpose or development. For a production site you <b>SHOULD</b> have this option turn Off. <br><u><font color=\"#FF0000\">Warning</font></u>: revealing PHP errors might help hacker secure information about your server.<br>','1','1395437821GPTU'),('By default set to Yes, it uses the minified files for CSS ( .css ) and javascript ( .js ) rather than the original.<div>eg: style.min.css</div><div>instead of style.css</div><div>The theme files can be automatically minified in the Themes listing.</div>','1','1395437822MMRI'),('Specify the CDN server to use.','1','1395437822MMRJ'),('Turn Off logs','1','1398375022BJSW'),('Yes to turn off all recording of logs into files.','1','1398375023DTKE'),('Font Awesome Icon','1','1400708734QLWF'),('Create a font awesome icon','1','1400708734QLWG'),('Define a button','1','1400708734QLWH'),('The prefix of the API key is not valid!','1','1401297229KKPC'),('Joomla Specific','1','1406645123NWLK'),('Yes to use collapsable tree for the pick list which has values with a hierarchy.<div>No to use standard pick list tree.</div>','1','1406645123NWLM'),('Collapsable Tree Pick-list','1','1407272965STVB'),('Once a day','1','1411052474RANJ'),('Once a week','1','1411052474RANK'),('Every other day','1','1411052474RANL'),('Once a month','1','1411052474RANM'),('Optimize database','1','1411052475FVUA'),('Clear cache','1','1411052475FVUB'),('Yes to allow the system to optimized the tables in the database.','1','1411052475FVUC'),('Define if the cache needs to be cleared automatically and at what frequency.','1','1411052475FVUD'),('A new application called $APPLICATION is available!','1','1413479920LDPJ'),('An update is available for $APPLICATION','1','1413479920LDPK'),('Un-minified themes could not be retreived.','1','1413490911HRES'),('API key error or not defined!','1','1415107844LLSU'),('Use 24 Hours Date','1','1416385932KENZ'),('Yes to 24 hours style for the time rather than 12 hours AM / PM','1','1416385933AEDN'),('Log Install traces','1','1416812826GUVH'),('Show Configuration','1','1416812826GUVI'),('Show Page Details','1','1416812826GUVJ'),('Enables to directly edit and customize views.','1','1416812826GUVK'),('Yes to log the installation traces.','1','1416812826GUVL'),('Display a Panel at the bottom of the page with all the Preferences used to display the page.','1','1416812826GUVM'),('Display a Panel at the bottom of the page with all the information regarding the page.','1','1416812826GUVN'),('If the Itemid is not defined in the page, the specified value will be used.<br>Can be useful to avoid a link to render the front-end page modules.<span style=\"font-weight: bold;\"><br></span>','1','1418159312IWLR'),('<br><span style=\"font-style: italic; text-decoration: underline; font-weight: bold;\">About Update and Install:</span><br><ul><li>First click on <span style=\"font-weight: bold;\">Check</span> to get an updated list of all Applications available.</li><li>To install or update an application click on the <span style=\"font-weight: bold;\">Name</span> of the application you want to install.  You will be redirected to the main page of the application.</li><li>To change the grade of an application, click on the link in the <span style=\"font-weight: bold;\">Grades</span> column.</li></ul><span style=\"text-decoration: underline; font-style: italic; font-weight: bold;\">About License:</span><br><ul><li>If you have a token you can simply click on <span style=\"font-weight: bold;\">Enter token</span> and follow instruction.</li><li>You can use the button <span style=\"font-weight: bold;\">Refresh</span> to refresh all your licenses. It will re-actualize all your licenses.<br></li></ul>','1','1418159313RUIV'),('This is a list of all possible translation in any installed language:<br><br>1. To find your translation first select the proper language in the pick-list.<br>2. Choose your application<br>3. Click on the \"Edit\" button to edit the translation.<br>4. In case you do not find the proper string look for it in the main library in jCenter or jApps.<br><br>','1','1418159313RUIW'),('<span style=\"font-weight: bold; text-decoration: underline;\">Example of strings:</span><br><br>TR1242010181DZGB=Successfully Ordered $NUMBER $ELEMENT<br><br><span style=\"color: rgb(0, 51, 255);\">IMPORTANT</span>: <br>Make sure to respect the punctuation, cases and spacing as much as possible.<br>Sometimes you might see HTML tags or { tag: ... } in the definition, please leave it the way it is.<br><br><span style=\"color: rgb(0, 51, 255);\">VERY IMPORTANT: </span><br>Please do not touch the first string before the equal sign ( TR1242010181DZGB= ), it will result in translation not working. <br>The text to be translated is everything after the equal sign.<br><br><span style=\"color: rgb(0, 51, 255);\">VARIABLES</span>:<br>When you see a UPPER CASE string with a dollars sign in front ( $ELEMENT ), DO NOT translate, as it will be replaced by a variable or other string. However if you language require to reorder the works and the variable feel free to do so. The UPPER name of the of the variable give you an indication of what it will be replaced with.<br><br><span style=\"color: rgb(0, 51, 255);\">FINAL WORD</span><br>if you are looking for a string and dont find it, it might be in the main library so look for it into jCenter or jApps translation.<br><br>','1','1418159313RUIX'),('<p style=\"line-height: 1.4em;\">Please note that the site where you enter the API key FIRST will be the only site you are entitled for free support. <br>If you have a production site and a development site you need to decide if you prefer getting support for the production site or for the development site.<br>It is not possible to change the site on which you get primary support at a later time.<br> Should you have further question please <a target=\"_blank\" href=\"https://www.joobi.co/r.php?l=support\">contact the support.</a><br></p>','1','1418159317GYIO'),('Impossible to publish Widget without the application \"$APLLICATION\" installed on the site.','1','1418159318SHOQ'),('Yes to use a captcha on forms.','1','1418860444IRBO'),('Choose','1','1421617710FQCB'),('Uninstall App','1','1421617712NRTN'),('Uninstall Only One App','1','1421617713IRWT'),('Uninstall All Apps','1','1421617713IRWU'),('Remove All Apps and All Data in Database','1','1421617713IRWV');
