BI'),('This view shows a list of languages.  If the language is marked as \"Available\" then this language is available on your site.<br>Please note that a language available does not necessarily means that it is available for all applications.<br><br>The columns \"Site\" and \"Admin\" indicate if the language is available on for the CMS respectively in the front-end (Site) or back-end (Admin) of the website.<br><br><span style=\"text-decoration: underline; color: rgb(0, 0, 153);\">MENU:</span> <br><ul><li>The \"<span style=\"font-weight: bold;\">Synchronize</span>\" button enables you to synchronize the languages available with the CMS.</li><li><span style=\"font-weight: bold;\">Export</span>: use to export the language file for an application so that you can edit the translation.</li><li><span style=\"font-weight: bold;\">Import</span>: use to import the modified language file.<br></li></ul>','1','1212843247FGZJ'),('Thank you very much for your contribution!','1','1213020853MLHS'),('The list of available languages has been synchronized with the site.','1','1213107637HXCR'),('Specify the language you want to take as the origin language from which you want to translate.','1','1213107638BOKE'),('Specify the language in which you want to translate the application.<br />It is important that you specify this language so that we can optimize the exported file so that you do not have to translate something which is already translated.','1','1213107638BOKF'),('There was an error sending the file.  Please send the file by email to: $EMAIL .','1','1213285236EJWF'),('This language is already available in the general release for this application. The translation was not sent.  If you feel like the translation need to be corrected and you want to submit your file please send it to the Joobi Team by email at: $EMAIL .','1','1213285236EJWG'),('Button','1','1219769905FKPU'),('Automatic Translation','1','1219769913SSNZ'),('Translations','1','1220793710GXYB'),('Vendors','1','1220793