INSERT IGNORE INTO `#__translation_en` (`text`,`auto`,`imac`) VALUES ('The password confirmation does not match the password.','1','1401465958GTFQ'),('Random String','1','1401465959YVL'),('Admin User Strength','1','1401465959YVM'),('HTML emails','1','1401465959YVN'),('Use Mobile','1','1401465959YVP'),('Default Username','1','1401465959YVQ'),('Use Currency','1','1401465959YVR'),('Register User Strength','1','1401465959YVS'),('Framework Role','1','1401465959YVT'),('Define the URL to redirect to when the users click on My Account button.<div>Leave empty for default Users dashboard.</div>','1','1401465959YVU'),('Define the required strength of administrator users’ password.<br>','1','1401465959YVV'),('Specified preferred language.','1','1401465959YVW'),('Receive email in HTML format.','1','1401465960RGMK'),('Specified the preferred currency.','1','1401465960RGML'),('Set to Yes to ask the mobile phone of the user.','1','1401465960RGMM'),('Set to Yes to ask the preferred currency to the user.','1','1401465960RGMN'),('Define the required strength of standard users’ password.','1','1401465960RGMO'),('Define the minimum role to update the framework user database.<div><u>Recommended</u>: “Register\"</div>','1','1401465960RGMP'),('Lock user','1','1401465960RGMQ'),('Delete Users','1','1401465960RGMR'),('Unfortunately, your account has not been approved on {widget:sitename}','1','1401465960RGMS'),('<p>Hello {widget:param|name=name},</p><p> </p><p>Unfortunately! Your account has not been approved on {widget:sitename}.</p><p>Please contact the administrator should you need more details.</p><p><br></p><p>Best regards,</p><p>{widget:sitename} Team<br></p>','1','1401465960RGMV'),('User Horizontal Menu FE','1','1401473376KUOI'),('User Dashboard','1','1401473376KUOJ'),('Allow username change','1','1401721045QFQW'),('Use Avatar','1','1401721045QFQX'),('Set to Yes to let user upload an avatar.','1','1401721045QFQY'),('Upload an image for your avatar.','1','1401721045QFQZ'),('Users Button for Control Panel','1','1401721045QFRA'),('The password could not be email because the user ID was not found.','1','1401818484FRIA'),('Registration is not allowed!','1','1401855798FZFQ'),('The user has been approved!','1','1401855798FZFR'),('The user has been denied access to the website!','1','1401855798FZFS'),('New user \"{widget:param|name=username}\" has registered to the website {widget:sitename}','1','1401855800NDHG'),('New user \"{widget:param|name=username}” need approval','1','1401855800NDHH'),('Congratulation, you have been approved on {widget:sitename}','1','1401855800NDHI'),('You need to confirm your email address on {widget:sitename}','1','1401855800NDHJ'),('<p>Hello admin,</p><p>&nbsp;</p><p>A new user has registered to the website&nbsp;{widget:sitename}</p><p><br></p><p><strong>Here are the user information.</strong></p><p><span style=\"text-decoration: underline;\">Name:</span>&nbsp;{widget:param|name=name}</p><p><span style=\"text-decoration: underline;\">Username:</span> {widget:param|name=username}</p><p><span style=\"text-decoration: underline;\">Email:</span> {widget:param|name=email}</p><p><span style=\"text-decoration: underline;\">Language:</span>&nbsp;{widget:param|name=language}<br></p><p><span style=\"text-decoration: underline;\">Country:</span>&nbsp;{widget:param|name=country}<br></p><p><span style=\"text-decoration: underline;\">Timezone:</span>&nbsp;{widget:param|name=timezone}<br></p><p><br></p><p><br></p>','1','1401855800NDHK'),('<p>Hello admin,</p><p>&nbsp;</p><p>A new user has registered to the website&nbsp;{widget:sitename} and needs your approval.</p><p><b>Go to the following link to approve the user:</b></p><p>{widget:param|name=approvalLink}<br></p><p><br></p><p><strong>Here are the user information.</strong></p><p><span style=\"text-decoration: underline;\">Name:</span>&nbsp;{widget:param|name=name}</p><p><span style=\"text-decoration: underline;\">Username:</span> {widget:param|name=username}</p><p><span style=\"text-decoration: underline;\">Email:</span> {widget:param|name=email}</p><p><span style=\"text-decoration: underline;\">Language:</span>&nbsp;{widget:param|name=language}<br></p><p><span style=\"text-decoration: underline;\">Country:</span>&nbsp;{widget:param|name=country}<br></p><p><span style=\"text-decoration: underline;\">Timezone:</span>&nbsp;{widget:param|name=timezone}<br></p><p><br></p><p><br></p>','1','1401855800NDHL'),('<p>Hello {widget:param|name=name},</p><p> </p><p>Congratulation! You have been approved to  {widget:sitename}.</p><p>You can now login with your credentials:</p><p><br></p><p><span style=\"text-decoration: underline;\">Name:</span> {widget:param|name=name}</p><p><span style=\"text-decoration: underline;\">Username:</span> {widget:param|name=username}</p><p><span style=\"text-decoration: underline;\">Email:</span> {widget:param|name=email}</p><p><br></p><p>We look forward to your visit,</p><p>{widget:sitename} Team</p>','1','1401855800NDHM'),('<p>Hello {widget:param|name=name},</p><p>&nbsp;</p><p>This is the final step to access&nbsp;</p><p>Thank you for registering at&nbsp;{widget:sitename}. &nbsp;Your account is created and must be activated before you can use it.</p><p>To activate the account click on the following link or copy-paste it in your browser:</p><p>{widget:param|name=selfApprovalLink}</p><p><br></p><p>After activation you may login to {widget:siteurl} using you credentials</p><p>{widget:param|name=credentials}<br></p><div style=\"cursor: pointer; width: 16px; height: 16px;display: inline-block;\" e26f27915a6b878d=\"j32.joobiplex.com\"><div><div style=\"cursor: pointer; width: 16px; height: 16px;display: inline-block;\" e26f27915a6b878d=\"j32.joobiplex.com\"><br></div></div><div><div style=\"cursor: pointer; width: 16px; height: 16px;display: inline-block;\" e26f27915a6b878d=\"j32.joobiplex.com\"><br></div></div>&nbsp;</div><p>Best regards,<br></p><p>{widget:sitename} Team</p>','1','1401855800NDHN'),('You account could not be created!','1','1401908086NTVF'),('Your account has been created, however the administrator need to approve it before you can login!','1','1401908086NTVG'),('Your account has been created and an activation link has been sent to the email address you entered.','1','1401908086NTVH'),('Note that you must activate the account by clicking on the activation link when you receive the email before you can login.','1','1401908086NTVI'),('Your account has been created, you are now login!','1','1401908086NTVJ'),('Your account has been created, please login!','1','1401908086NTVK'),('Registration landing page','1','1401908087BVRZ'),('Option: specify an email address where the notification of new subscribers should be sent to. If not specified the notification will go to all Super administrators.<div>Hint: separate multiple emails with a comma.</div>','1','1401908087BVSA'),('Hello {widget:name} welcome to {widget:sitename},\r\n\r\nHere are your account information.  \r\n\r\nUsername: {widget:param|name=username}\r\nPassword: {widget:param|name=password}\r\nEmail: {widget:param|name=email}\r\n\r\nPlease make sure you keep those credentials in a secure and safe place. You will need them to login again on our website.\r\n\r\nWe highly recommend that next time you login you change the password.\r\n\r\nBest regards\r\n{widget:sitename} Team\r\n\r\n','1','1401908088KSZQ'),('Hello {widget:name},\r\n\r\nHere is a new password for your account.\r\nMake sure you change the password once you have logged in.\r\n\r\nPassword: {widget:param|name=password}\r\n\r\nPlease make sure you keep those credentials in a secure and safe place.\r\nBest regards,\r\n\r\n{widget:sitename} Team','1','1401908088KSZR'),('<p>Hello {widget:name} welcome to {widget:sitename},</p><p>&nbsp;</p><p><strong>Here are your account information.</strong></p><p><span style=\"text-decoration: underline;\">Username:</span> {widget:param|name=username}</p><p><span style=\"text-decoration: underline;\">Password:</span> {widget:param|name=password}</p><p><span style=\"text-decoration: underline;\">Email:</span> {widget:param|name=email}</p><p>&nbsp;</p><p>Please make sure you keep those credentials in a secure and safe place. You will need them to login again on our website. We highly recommend that next time you login you change the password.</p><p>Best regards,</p><p>{widget:sitename} Team</p>','1','1401908088KSZS'),('<p>Hello {widget:name},</p><p>&nbsp;</p><p><strong>Here is a new&nbsp;password for your account.</strong></p><p><strong><font color=\"#ff0000\">Make sure you change the password once you have logged in.</font></strong></p><p><span style=\"text-decoration: underline;\">Password:</span> {widget:param|name=password}</p><p>&nbsp;</p><p>Please make sure you keep those credentials in a secure and safe place.</p><p>Best regards,</p><p>{widget:sitename} Team</p>','1','1401908088KSZT'),('Login and Registration are disable for the moment!','1','1402327858JCQW'),('Login is disabled at the moment.','1','1402327860NWWL'),('You cannot delete your user from the database!','1','1402327860NWWM'),('Allow User Login','1','1402327862IRBJ'),('Ask for HTML email','1','1402327862IRBK'),('If set to No, no user will be able to register or create an account.<div><font color=\"#cc0000\"><u>Important</u>:</font> some application might not work properly if user cannot register or subscribe.</div>','1','1402327862IRBL'),('Set to Yes to ask the user if their want HTML or text only emails.','1','1402327862IRBM'),('1401853439','1','1404175053SXGE'),('1401853196','1','1404175053SXGF'),('Username and password does not match!','1','1406645169SRMK'),('Login landing page','1','1406645170POVD'),('Define a URL for the registration page.<div>Leave empty for default registration page.</div><div><u>Warning:</u> for this preference to be active user management needs to be “Users” or \"Contacts\"</div>','1','1406645171LJLM'),('Only Login','1','1406858734GTFR'),('Login & registration','1','1406858734GTFS'),('Login & Registration','1'